import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Focus on search input and type query
    const searchInput = await page.waitForSelector('#searchInput', { timeout: 5000 });
    await searchInput.click();
    await searchInput.type('iPhone', { delay: 100 });

    // Wait for search suggestions to appear
    await page.waitForSelector('.search-suggestions', { timeout: 5000 });

    // Take screenshot of autocomplete dropdown
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_autocomplete.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_autocomplete.png'));

    // Extract suggestion data
    const suggestions = await page.$$eval('.suggestion-item', elements => 
      elements.map(el => el.textContent.trim())
    );

    // Verify suggestions contain relevant content
    const hasRelevantSuggestions = suggestions.some(suggestion => 
      suggestion.toLowerCase().includes('iphone')
    );

    if (!hasRelevantSuggestions) {
      throw new Error('No relevant search suggestions found for "iPhone"');
    }

    return {
      success: true,
      action: "Tested search autocomplete functionality by typing 'iPhone' and verified suggestions appear",
      extractedData: {
        suggestions: suggestions,
        suggestionCount: suggestions.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to test search autocomplete functionality",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
